import {RatedServiceName} from './ratedServiceName';
export const VoteComponent = ({services=[]})=>{
    return(
        <div>
            <div>{services.map((vote)=>{
                return(
                    <li  key={vote.id}>
                        <div>
                        <RatedServiceName service={vote.service}/>
                        <p>{vote.votes}</p>
                        </div>
                    </li>
                )
            })}</div>
        </div>
    );
}
